import React from "react";
import "./card.css";
import CardItem from "./carditem2";

function Cards() {
  return (
    <div className="cards">
      <h1>WHY?</h1>
      <div className="cards__container">
        <div className="cards__wrapper">
          <ul className="cards__items">
            <CardItem
              text="비슷한 부류의 다른 사람들과 함께 하면 즐겁겠죠? 또한, 당연히 혼자 하는 것보다 함께 하는 것이 빠르게 학습하고 성장할 수 있습니다"
              label="함께하는 즐거움"
              path="/services"
            />
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Cards;
